(1, 'Amajd Aloush', 'After reading a lot of good reviews of this restaurant, we decided to give them a try. There are a lot of choices for us and we do enjoy their salad and veggie dishes, they were fresh and delicious with their own style. The staffs were friendly. Well highly recommended.'),
